import React, { Component } from "react";

export class Questionbar extends Component {
  render() {
    return (
      <div className="questionbar-container">
        <div className="mood-container questionbox"></div>
        <div className="quizz-container questionbox"></div>
        <div className="chat-container questionbox"></div>
        <div className="influencers-containe questionbox"></div>
      </div>
    );
  }
}

export default Questionbar;
